import cards from "./data/cards"

function getRandomCards() {
    return cards;
}


export default function CelticCross() {
    Index.getInitialProps = async function() {
        const res = this.getRandomCards();
        const data =  res.json();

        return {
          cards: data.map(entry => entry.show)
        };
    };

    return (
        <div>
            here is a gameboard +.
        </div>
    );

}
